            <table className="table table-striped table-bordered">
                <thead className="thead-dark">
                    <tr>
                        <th>ID</th>
                        <th>Departure From</th>
                        <th>Arrival To</th>
                        <th>Departure</th>
                        <th>Return Date</th>
                        <th>Seats Available</th>
                    </tr>
                </thead>
                <tbody>
                    {flights.map(flight => (
                        <tr key={flight.id}>
